import React from "react";
import { useNavigate } from "react-router-dom";

function CalView() {
    const navigate = useNavigate();

    return (
        <div>
            <h1>Calendar View</h1>
            <button onClick={() => navigate("/")}>Back to Home</button>
        </div>
    );
}

export default CalView;
